    false,nt"url": null,nt"notes": "This annual narrative report for Great
    Meadows National Wildlife Refuge outlines Refuge accomplishments during the 1981
    calendar year. The report begins with a summary of the year's highlights and weather
    conditions. Land acquisition is covered. The report includes a planning section
    which discusses research and investigations. Refuge administration is outlined;
    information about personnel, funding, and safety is given. Habitat management is
    also covered; subjects include wetlands, forests, grasslands, pest control, and
    water rights. The wildlife section of the report discusses wildlife diversity, endangered
    and threatened species, waterfowl, marsh birds and waterbirds, shorebirds, raptors,
    game mammals, fisheries resources, and marking and bird banding. The public uses
    of the Refuge described in this report include outdoor classrooms, interpretive
    programs, hunting, fishing, wildlife observation, outdoor recreation, and law enforcement.
    The equipment and facilities section of the report provides information about rehabilitation
    and energy conservation. Cooperative programs and items of interest are provided
    at the end",nt"license_title": "License Not Specified",nt"extras": [{ntt"key":
